import React from "react";
import ReactDOM from "react-dom/client";

import './index.css';

import App from "./App";

function ncard(val) {
  return ( 
    <Card 
    key= {val.id}
    imgsrc={val.imgsrc}
    title={val.title}
    sname={val.sname}
    link={val.link}
  />
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <App />
);
